import './User.css';
import REturnArroW from './Arrow';
import REturnAvataR from './Avatar';
import REturnNAme from './Name';
import REturnLine from './Line';

import REturnNameSold from './NameSold';
import REturnPriX from './Prix';
import Media from 'react-media';

// User Component 
export default function REturnUseR() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => (
 <div className='wrp-user-box'>
  <REturnArroW />
  <REturnAvataR />
  <REturnNAme />
  <REturnLine />

  <REturnNameSold />
  <REturnPriX />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-user-box-sm'>
  <REturnArroW />
  <REturnAvataR />
  <REturnNAme />
  <REturnLine />

  <REturnNameSold />
  <REturnPriX />
 </div>
);
